  const [delItem, setdelItem] = useState();
  useEffect(() => {
    axios
      .get(`http://127.0.0.1:8000/api/person/`)
      .then((resp) => setpersons(resp.data));
  }, []);
  return (
    <div>
      <ul>
        {persons.map((person) => (
          <div key={person.id}>
            <li>{person.name}</li>
            <span>
              <RiDeleteBin6Line />
            </span>
          </div>
        ))}
      </ul>
    </div>
  );
}

